
var nameArray = ["Adobe Garamond Pro Bold", "Adobe Garamond Pro Bold", "Adobe Garamond Pro", "Adobe Garamond Pro", "Arial", "Arial", "Calibri", "Cambria Math", "Futura LT", "Garamond", "Garamond", "Minion Pro", "Times New Roman", "Times New Roman"];

var dataArray = ["", "", "", "", "", "", "", "", "", "", "", "", "", ""];

var fontStretch = ["", "", "", "", "", "", "", "", "", "", "", "", "", ""];

var fontWeight = ["bold", "bold", "normal", "normal", "bold", "normal", "normal", "normal", "normal", "normal", "normal", "normal", "bold", "normal"];

var fontStyleSubArray0 = ["normal"];

var fontStyleSubArray1 = ["italic", "oblique"];

var fontStyleSubArray2 = ["italic", "oblique"];

var fontStyleSubArray3 = ["normal"];

